import React from 'react'
import { makeStyles } from '@material-ui/core/styles'
import Box from '@material-ui/core/Box'

const useStyles = makeStyles((theme) => ({
    body: {
        display: 'flex',
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        flexDirection: 'column'
    }
}))

const Report = ({data, onClear}) => {
    const classes = useStyles()
    return (
        <Box className={classes.body}>
            <h2>{data.misc.name}</h2>
            <caption>I've predicted that {data.misc.name} will be 
            <span style={{ color: data.prediction == 'Bearish' ? 'red' : 'green'}}>{' ' + data.prediction}</span> 
            <br></br>with a confidence level of {(data.confidence*100).toFixed(2)}%</caption>
        </Box>
    )
}

export default Report
